import * as Types from '../constats'

const initialStateSearch = {
    searchFiled: ''
}

export const searchRobots 
        = (state=initialStateSearch, action={}) =>  {
    switch(action.type) {
        case Types.CHANGE_SEARCH_FIELD:
            return Object.assign({}, state, {searchFiled: action.payload})
        default:
            return state;
    }   

}
